(function() {
    'use strict';
         let pdfAll =  [];
         // ‰øùÂ≠òÂéüÂßãÁöÑfetchÂáΩÊï∞
            const originalFetch = window.fetch;
            // ÈáçÂÜôfetchÂáΩÊï∞‰ª•Êã¶Êà™ËØ∑Ê±Ç
            window.fetch = async function(resource, options) {
                // Ë∞ÉÁî®ÂéüÂßãfetchÂáΩÊï∞Ëé∑ÂèñÂìçÂ∫î
                const response = await originalFetch(resource, options);
               
                // Ê£ÄÊü•ÊòØÂê¶ÊòØÁõÆÊ†áAPIËØ∑Ê±Ç
                if (resource === 'https://magicplus-magicplus.apps.az.fxei.fedex.com.cn/documents/print' ||
                    (typeof resource === 'object' && resource.url === 'https://magicplus-magicplus.apps.az.fxei.fedex.com.cn/documents/print')) {

                    // ÂÖãÈöÜÂìçÂ∫î‰ª•ÈÅøÂÖçÂéüÂßãÂìçÂ∫îË¢´Ê∂àËÄó
                    const clonedResponse = response.clone();
                    try {
                        // Ëß£ÊûêÂìçÂ∫îÊï∞ÊçÆ
                        const data = await clonedResponse.json();

                        // Ê£ÄÊü•ÂìçÂ∫îÊòØÂê¶ÂåÖÂê´ÁõÆÊ†áÂ≠óÊÆµ
                        if (data.encodedDocuments && data.encodedDocumentNames) {
                            // Â§ÑÁêÜPDFÊï∞ÊçÆ - ËøôÈáåÂèØ‰ª•Ê†πÊçÆÈúÄÊ±ÇËá™ÂÆö‰πâÂ§ÑÁêÜÈÄªËæë
                            // Ê£ÄÊü•ÊòØÂê¶Â∑≤Â≠òÂú®Áõ∏ÂêåorderIdÁöÑËÆ¢Âçï
                            let orderExists = false;
                            for(var i=0; i<pdfAll.length; i++){
                                if(pdfAll[i].order_id === localStorage.getItem('order_id')){
                                    orderExists = true;
                                    break;
                                }
                            }
                             if(!orderExists){
                                pdfAll.push({
                                    order_id: localStorage.getItem('order_id'),
                                    pdf: data.encodedDocuments[0]
                                });
                            }
                            localStorage.setItem('fedex_print_docs', JSON.stringify(pdfAll));
                            console.log('üì¶ ÊçïËé∑Âà∞FedExÊâìÂç∞APIÂìçÂ∫î:',pdfAll);
                        }
                    } catch (error) {
                        console.warn('‚ùå Ëß£ÊûêÂìçÂ∫îÂ§±Ë¥•:', error);
                    }
                }
                // ËøîÂõûÂéüÂßãÂìçÂ∫î
                return response;
            };
})();